  [],\n\t\"num_tags\": 0,\n\t\"name\": \"niskin-bottle-data-of-the-hawaii-ocean-time-series-hot-program-in-the-north-pacific-100-miles-n2c74e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOT program makes repeated observations
  of the physics, biology and chemistry at a site approximately 100 km north of Oahu,
  Hawaii. Two stations are visited about once a month: Kahe Point (Station 1: 21.34N,
  158.27W) and Station ALOHA (Station 2: 22.75N, 158W). Various other stations are
  made intermittently in support of similar research objectives or mooring deployments.nnSamples
  of water column chemical analyses were collected mostly in the upper 1000m using
  Niskin bottles mounted on a rosette. The strategy was to sample at density horizons
  within the main thermocline at pressure horizons above and below this region (i.e.,
  <150 dbar and >2000 dbar). Care was applied to ensure the highest possible accuracy
  and precision.nnThis NODC accession contains Niskin Bottle data for HOT cruises
  249-258 during 2013. CTD and thermosalinograph data from the same cruises are available
  in separate NODC accessions. Historic data for HOT have also been archived at NODC.\",\n\t\"owner_org\":
